import React from 'react'
//import logo from './logo.svg';
import './App.css';
import PersonalFile from './PersonalFile'

class App extends React.Component {
  //CONSTRUCTOR
  constructor(props){
    super(props)
    this.state = {
      allUserFiles: {},
      allPilotFiles: {},
      currentPilotUsername: '',
      currentPilotFile: {},
      currentUserFile: {}
    }
  }

  //METHODS
  dataHandler = () => {

  }
  handlePilotInput = (event) =>{
    event.preventDefault()
    this.setState({currentPilotUsername: event.target.value})
  }

  async handlePilotSubmit (event) {
    event.preventDefault()
    const response = await fetch()
    const json = await response.json()
    this.setState({currentPilotFile: json})
  }

  //RENDER
  render() {
    return (
      <div >
        <h1>Pilot Microservice</h1>
        <p>Enter Username</p>
        <PersonalFile
        onPilotInput = {this.handlePilotInput}
        onPilotSubmit = {this.handlePilotSubmit.bind(this)} 
        />
      </div>
    )
  }
}

export default App;
